import React from 'react';
import db from '../db';

const DogList = () => {
    return (
        <div>
            <h1>Dogs</h1>
            <ul>
                <li>{db.dogs[0].name}</li>
                <li>{db.dogs[1].name}</li>
                <li>{db.dogs[2].name}</li>
            </ul>
        </div>
    );
}

export default DogList;
